<?phpnamespace Nemundo\WebLog\Data\Browser;class BrowserPaginationReader extends \Nemundo\Model\Reader\AbstractPaginationModelDataReader {/*** @var BrowserModel*/public $model;public function __construct() {parent::__construct();$this->model = new BrowserModel();}/*** @return BrowserRow[]*/public function getData() {$list = [];foreach (parent::getData() as $dataRow) {$row = new BrowserRow($dataRow, $this->model);$list[] = $row;}return $list;}}